paragraph.content:
Do not administer Docetaxel Injection to patients who have a history of severe hypersensitivity reactions to docetaxel or to other drugs formulated with polysorbate 80 [see Contraindications (4)
                        ]. Severe hypersensitivity reactions have been reported in patients despite dexamethasone premedication. Hypersensitivity reactions require immediate discontinuation of the Docetaxel Injection infusion and administration of appropriate therapy [see Warnings and Precautions (5.5)
                        ].

text.paragraph:
Patients treated with Docetaxel Injection in combination with cisplatin and fluorouracil must receive antiemetics and appropriate hydration according to current institutional guidelines. In both studies, G-CSF was recommended during the second and/or subsequent cycles in case of febrile neutropenia, or documented infection with neutropenia, or neutropenia lasting more than 7 days. If an episode of febrile neutropenia, prolonged neutropenia or neutropenic infection occurs despite G-CSF use, the Docetaxel Injection dose should be reduced from 75 mg/m2 to 60 mg/m2. If subsequent episodes of complicated neutropenia occur the Docetaxel Injection dose should be reduced from 60 mg/m2 to 45 mg/m2. In case of grade 4 thrombocytopenia the Docetaxel Injection dose should be reduced from 75 mg/m2 to 60 mg/m2. Do not retreat patients with subsequent cycles of Docetaxel Injection until neutrophils recover to a level >1500 cells/mm3 [see Contraindications (4)
                                       ]. Avoid retreating patients until platelets recover to a level >100,000 cells/mm3. Discontinue treatment if these toxicities persist [see Warnings and Precautions (5.3)
                                       ].

Treatment-related AML or MDS has occurred in patients given anthracyclines and/or cyclophosphamide, including use in adjuvant therapy for breast cancer. In the adjuvant breast cancer trial (TAX316) AML occurred in 3 of 744 patients who received docetaxel, doxorubicin, and cyclophosphamide (TAC) and in 1 of 736 patients who received fluorouracil, doxorubicin, and cyclophosphamide [see Clinical Studies (14.2)
                           ]. In TAC-treated patients, the risk of delayed myelodysplasia or myeloid leukemia requires hematological follow-up. Monitor patients for second primary malignancies [see Adverse Reactions (6.1)
                           ].

Explain to patients that Docetaxel Injection may impair their ability to drive or operate machines due to its side effects [see Adverse Reactions (6)
                           ] or due to the alcohol content of Docetaxel Injection [see Warnings and Precautions (5.13)
                           ]. Advise them not to drive or use machines if they experience these side effects during treatment.
